import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./navigation_bar/Home.js"
import About from "./navigation_bar/Home.js"
import Projects from "./navigation_bar/Home.js"
import Resume from "./navigation_bar/Home.js"
import Skills from "./navigation_bar/Home.js"


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
    <App/>
    <Routes>
      <Route path='/home' element={<Home/>}/>

    </Routes>
    </BrowserRouter>
  </React.StrictMode>

);
